import React from "react";
import './footer.css';

const Footer = () => {
    return(
        <section className='footer-section'>
            <p className="email">eg.souf@gmail.com</p>
            <div className='socials'>
            <FontAwesomeIcon icon={faXTwitter} />
            
            </div>
        </section>
    );
}

export default Footer;
